import React, { useState } from 'react';

const Header = () => {
  const [showMenu, setShowMenu] = useState(false);

  const toggleMenu = () => {
    setShowMenu(!showMenu);
  };

  return (
    <header>
      <nav className="navbar">
        <div className="logo">
          <img src="images/logo/lo" className="logi" alt="PAWS VEDA Logo" />
        </div>
        <div className="add-icon">
          <p><b>P</b></p>
          <span style={{ fontSize: "20px" }}>&#128062;</span>
          <p><b>aws </b></p>
          <p><b>Veda</b></p>
        </div>
        <div className="nav-search">
          <img src="images/WhatsApp Image 2024-05-16 at 12.14.57 AM.jpeg" style={{ height: "20px", margin: "0 20px" }} alt="WhatsApp" />
          <input placeholder="Search" className="search-input" />
          <img src="images/seach.jpeg" style={{ height: "20px", margin: "5px 15px" }} alt="Search Icon" />
        </div>
        <div className="icon">
          <ul>
            <li><i className="fas fa-shopping-bag"></i><span className="sr-only">Shopping Bag</span></li>
            <li><i className="fas fa-user-circle"></i><span className="sr-only">User Profile</span></li>
          </ul>
        </div>
        {/* Responsive menu button */}
        <div className="responsive-menu" onClick={toggleMenu}>
          <i className="fas fa-bars"></i>
        </div>
      </nav>
      {/* Responsive menu */}
      {showMenu && (
        <div className="header1">
          <a className="h" href="#home"><i className="fas fa-home"></i> Home</a>
          <a className="h" href="#shop"><i className="fas fa-store"></i> Shop</a>
          <a className="h" href="#PetCare"><i className="fas fa-paw"></i> Pet care</a>
          <a className="h" href="#pet-accessories"><i className="fas fa-paw"></i> Pet Accessories</a>
          <a className="h" href="#about"><i className="fas fa-info-circle"></i> About</a>
        </div>
      )}
    </header>
  );
}

export default Header;
